// TitleBar.js

import React from "react";

const TitleBar = () => {
  return (
    <div class="w-[360px] h-14 relative shadow">
      <div class="w-[360px] h-14 left-0 top-0 absolute bg-sky-600"></div>
      <div class="w-[250px] h-7 left-[7px] top-[14px] absolute text-center text-white text-sm font-medium font-['Cabin'] uppercase leading-normal tracking-tight">
        WELLNEST: MOOD TRACKING FEATURE
      </div>
    </div>
  );
};

export default TitleBar;
